data.text:
@greggpeg7 @supitsshekinah @LTHlondon When you use a band aid, you might notice it blends in with your complexion. A privilege people of colour don’t have. 
No one has ever even thought to produce them. 
I don’t want a row, I just want us to accept that a lot of things are made with only one skin colour in mind.

